import React from 'react'
import './Freetrial.scss'
import {useState} from 'react'
import Footer from "components/footers/MiniCenteredFooter2.js";
import Header from "components/headers/light2.js";
import styled from "styled-components";
//import Header from "./header2";
import gratuit from '../../images/sanoGratuit.png'

function Freetrial() {
  return (
    <div className='free'>
      
<HeaderStyle>
   <Header />
</HeaderStyle>

   <div className="test">
    <div className="text">
    <img src={gratuit} alt="" />

    <div className="text-card">
      <h3>
        Plan nutritionel personalisé d'une journée 
      </h3>

    </div>

    </div>

   </div>
   <div className="footer-fix">
    <Footer /> 
     </div>
</div>
  )



}
const HeaderStyle = styled.div`
padding-top: 1rem;
padding-bottom: 1rem;

`



export default Freetrial
